import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import SingleProduct from '../Common/SingleProduct';



import img1 from '../assets/images/books/1.jpg';
import img11 from '../assets/images/books/2.jpg';
import img2 from '../assets/images/books/3.jpg';
import img22 from '../assets/images/books/4.jpg';
import img3 from '../assets/images/books/5.jpg';
import img33 from '../assets/images/books/6.jpg';
import img4 from '../assets/images/books/7.jpg';
import img44 from '../assets/images/books/8.jpg';

const products = [
    {status: 'ban chay', productname: 'Bowen Greenwood', price: '99.000', oldprice: '1000.000', star1: 'on', star2: 'on', star3: 'on', star4: 'on', star5: '', image1: img1, image2: img11 },
    {status: 'hot', productname: 'The liar', price: '999.000', oldprice: '100.000', star1: 'on', star2: 'on', star3: 'on', star4: 'on', star5: 'on', image1: img2, image2: img22 },
    {status: 'ban chay', productname: 'Come here to me', price: '99.000', oldprice: '1000.000', star1: 'on', star2: 'on', star3: '', star4: '', star5: '', image1: img3, image2: img33 },
    {status: 'ban chay', productname: 'What the fuck?', price: '999.000', oldprice: '100.000', star1: 'on', star2: 'on', star3: 'on', star4: '', star5: '', image1: img4, image2: img44 },
];

class NewProducts extends Component{
    render(){
        return(
            <div>
                <section className="wn__product__area brown--color pt--80  pb--30">
                    <div className="container">
                        <div className="row">
                            <div className="col-lg-12">
                                <div className="section__title text-center">
                                    <h2 className="title__be--2">New <span className="color--theme">Products</span></h2>
                                    <p>{this.props.title}</p>
                                </div>
                            </div>
                        </div>
                        {products.map((product, index) => {
                            return <SingleProduct {... product} key={index} />
                        })}
                    </div>
                </section>
            </div>
        )
    }
}

export default NewProducts;
